import './GameVS.css'

interface GameVSProps {
  player1: string | null,
  player2: string | null
}

export default function GameVS(props: GameVSProps) {
  return (
    <div className="game-vs">
        <div className="game-vs-p1">{props.player1}</div>

        <div className="game-vs-vs">VS</div>

        <div className="game-vs-p1">{props.player2}</div>
    </div>
  )
}
